import * as React from "react";
import { AppBar, Toolbar, Typography, Box, Button, IconButton } from "@mui/material";
import HomeIcon from "@mui/icons-material/Home";
import BrushIcon from "@mui/icons-material/Brush";
import CameraAltIcon from "@mui/icons-material/CameraAlt";
import MusicNoteIcon from "@mui/icons-material/MusicNote";
import LocalFloristIcon from "@mui/icons-material/LocalFlorist";
import PersonIcon from "@mui/icons-material/Person";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";

// Define the props for NavigationBar
interface NavigationBarProps {
  setActiveSection: (section: string) => void; // Function to update the active section
}

const NavigationBar: React.FC<NavigationBarProps> = ({ setActiveSection }) => (
  <AppBar position="static" color="default" elevation={1} sx={{ backgroundColor: "#fff" }}>
    <Toolbar sx={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
      {/* Logo */}
      <Typography variant="h6" sx={{ fontWeight: "bold", textTransform: "uppercase" }}>
        Logo Placeholder
      </Typography>
      {/* Navigation Buttons */}
      <Box sx={{ display: "flex", gap: 2 }}>
        <Button startIcon={<HomeIcon />} onClick={() => setActiveSection("venues")}>
          Venues
        </Button>
        <Button startIcon={<BrushIcon />} onClick={() => setActiveSection("makeup")}>
          Makeup
        </Button>
        <Button startIcon={<CameraAltIcon />} onClick={() => setActiveSection("photographers")}>
          Photographers
        </Button>
        <Button startIcon={<MusicNoteIcon />} onClick={() => setActiveSection("music")}>
          Music
        </Button>
        <Button startIcon={<LocalFloristIcon />} onClick={() => setActiveSection("florist")}>
          Florist
        </Button>
        <Button startIcon={<PersonIcon />} onClick={() => setActiveSection("planner")}>
          Planner
        </Button>
      </Box>
      {/* Shopping Cart */}
      <IconButton>
        <ShoppingCartIcon />
      </IconButton>
    </Toolbar>
  </AppBar>
);

export default NavigationBar;
